This weekend we took things to a whole new level for Devin & Matt where we created and built their reception space with levels, stairways and risers for our stairway to Heaven concept! 
⠀⠀⠀⠀⠀⠀⠀⠀⠀
Our team battled the intense heat wave during our multi day set up, worked tirelessly into the wee hours and there were moments that we found ourselves pushing harder than we’ve ever had to before but the end result was the coolest of vibes!! There will always be an irreplaceable feeling that comes from watching guests step into a space that was built with intention and love and seeing Matt & Devin experience it all was so worth it! We are so happy for you @mattfaulk and @devinnnanne 🤍 Beyond grateful for your trust and the passion & resiliency of all who poured their hearts into this project and were part of the transformation! Sharing some quick behind the scene photos while we wait for the real beauties that are on their way from @jamesandschulze 
